OUApp.Modules.ui_widgets={toggler:function(){$(".int-toggler").each(function(){var i=$(this).find(".int-toggleTrigger");i.html('<a href="#"><b class="int-icon-btn closed"><i class="int-icon int-icon-plus"></i></b><b class="int-icon-btn open"><i class="int-icon int-icon-minus"></i></b><span> '+i.text()+"</span></a>")}),$(".int-toggleTrigger").on("click",function(i){i.preventDefault(),$(this).parent().toggleClass("int-active")})},accordion:function(){$(".int-accordion").accordion({heightStyle:"content"})},init:function(){this.accordion(),this.toggler()}};